import React, { useEffect } from 'react'
import './PintrestStyle.css'


const Pintrest = () => {

    useEffect(() => {
        const script = document.createElement('script')
        script.async = true
        script.type = 'text/javascript'
        script.dataset.pinBuild = 'doBuild'
        script.src = '//assets.pinterest.com/js/pinit.js'
        document.body.appendChild(script)
        if (window.doBuild) window.doBuild()
      }, [])

    return (
        <div className='pintrest-container'>
            <div className='pintrest-box'>
                <div className='pintrest-board'>
                <a data-pin-do="embedBoard" data-pin-board-width="500" data-pin-scale-height="600" data-pin-scale-width="100" href="https://www.pinterest.com/dollskill/widow/"></a>
                </div>
                <div className='pintrest-board'>
                <a data-pin-do="embedBoard" data-pin-board-width="500" data-pin-scale-height="600" data-pin-scale-width="100" href="https://www.pinterest.com/dollskill/widow/"></a>
                </div>
            </div>
        </div>
    )
}

export default Pintrest
